<template>
  <div class="graph-settings" v-if="showModal">
    <Modal
      :width="667"
      :height="613"
      :controls="true"
      :resizable="true"
      :only-parent="true"
    >
      <template v-slot:modal__header>
        <h3 class="modal__title graph-settings__subtitle">
          Схема взаимосвязей {{ getMainNode.ObjectName }}
        </h3>
      </template>
      <template v-slot:content>
        <div class="graph-settings__wrapper">
          <div class="graph-settings__item" v-if="activeLink === 'content'">
            <div class="graph-content__field">
              <img src="@/assets/icons/graph/object.svg" alt="icon" />
              <input
                type="text"
                class="graph-content__input"
                v-model="name"
                :class="{ field__writing: name === '' }"
              />
            </div>
            <h2 class="graph-content__title">Общие</h2>
            <p class="graph-content__subtitle">Объект</p>
            <p class="graph-content__text">Электронная почта</p>
            <p class="graph-content__subtitle">Описание</p>
            <textarea
              class="graph-content__textarea"
              v-model="description"
            ></textarea>
            <h2 class="graph-content__title">Парамметры построения</h2>
            <p class="graph-content__subtitle">
              Не загружать элементов больше, чем
            </p>
            <input
              type="number"
              class="graph-content__input graph-content__input-num"
              v-model="downloadMore"
              min="0"
            />
            <p class="graph-content__subtitle">Не загружать глубже, чем</p>
            <input
              type="number"
              class="graph-content__input graph-content__input-num"
              v-model="downloadDeeper"
              min="0"
            />
            <div class="graph-settings__btns">
              <button
                class="btn__second-priority button graph-settings__btn"
                @click="hideModal"
              >
                Отмена
              </button>
              <button
                class="btn__first-priority button graph-settings__btn"
                @click="saveSettingsGraph"
              >
                Сохранить
              </button>
            </div>
          </div>
          <div class="graph-settings__item" v-else>
            <h1>История</h1>
