<script>
import { mapGetters } from "vuex";

import Modal from "../../components/UI/Components/Modal";
export default {
  name: "GraphModalSettings",
  components: {
    Modal,
  },
  props: {
    showModal: Boolean,
  },
  data() {
    return {
      activeLink: "content",
      name: "",
      description: "",
      downloadMore: 0,
      downloadDeeper: 0,
    };
  },
  computed: {
    ...mapGetters({
      currentNode: "getCurrentNode",
      getMainNode: "getMainNode",
    }),
  },
  methods: {
    saveSettingsGraph() {
      if (this.name !== "") {
        this.$emit("closeGraphModalSettings");
      } else {
        this.showErrorField();
      }
    },
    hideModal() {
      this.showSweetModal();
    },
    showSweetModal() {
      this.$swal({
        html:
          '<h2 class="sweet__title">Закрытие формы</h2>' +
          '<p class="sweet__description">Вы действительно хотите закрыть форму с потерей всех изменений?</p>',
        showCloseButton: false,
        showCancelButton: true,
        showConfirmButton: true,
        confirmButtonText: "Да",
        cancelButtonText: "Отмена",
        confirmButtonColor: "#aedef4",
        cancelButtonColor: "#b6b6b6",
        allowOutsideClick: false,
        focusConfirm: false,
        focusCancel: false,
      }).then((result) => {
        if (result.value) {
          this.$emit("closeGraphModalSettings");
        } else {
          this.$swal.close();
        }
      });
    },
    showErrorField() {
      this.$swal({
        html:
          '<h2 class="sweet__title">Не заполнены обязательные поля</h2>' +
          `<p class="sweet__description">Заполните поле "Название схемы взаимосвязей"`,
        showCloseButton: false,
        showCancelButton: false,
        showConfirmButton: true,
        confirmButtonText: "ОК",
        confirmButtonColor: "#aedef4",
        allowOutsideClick: false,
        focusConfirm: false,
        focusCancel: false,
      });
    },
  },
  mounted() {
    this.name = this.getMainNode.ObjectName;
  },
};
</script>

